/********************************************************************
* FUNCTION u_o_ran_performance_management_performance_measurement_objects_rx_window_measurement_objects_active_edit
*
* Edit database object callback
* Path: /performance-measurement-objects/rx-window-measurement-objects/active
* Add object instrumentation in COMMIT phase.
*
* INPUTS:
*     see agt/agt_cb.h for details
*     k_ parameters are ancestor list key values.
*
* RETURNS:
*     error status
********************************************************************/
status_t u_o_ran_performance_management_performance_measurement_objects_rx_window_measurement_objects_active_edit (
    ses_cb_t *scb,
    rpc_msg_t *msg,
    agt_cbtyp_t cbtyp,
    op_editop_t editop,
    val_value_t *newval,
    val_value_t *curval,
    const xmlChar *k_performance_measurement_objects_rx_window_measurement_objects_measurement_object)
{
    status_t res = NO_ERR;
    boolean newval_val = (newval) ? VAL_BOOL(newval) : 0;
    boolean curval_val = (curval) ? VAL_BOOL(curval) : 0;
    (void)curval_val;/* remove yumaworks warning */
    (void)scb;/* remove yumaworks warning */
    (void)msg;/* remove yumaworks warning */

    if (LOGINFO) {
        log_info("\nEnter %s:callback for %s phase", __func__, agt_cbtype_name(cbtyp));
    }
    
    /* 管理テーブルの内容からEDIT_MSIを送信する */
    switch (cbtyp) {
    case AGT_CB_VALIDATE:
        /* Edit数の初期化 */
        edit_measurement_object_act_cnt = 0;
        /* description-stmt validation here */
        /* object名からactive/deactiveをチェック */
        res =i_pfm_mng_rx_window_active_validate(k_performance_measurement_objects_rx_window_measurement_objects_measurement_object, newval_val);
        if(res != NO_ERR){
            if(LOGWARN){
                log_warn("\n%s: object_name is incorrect.",__func__);
            }
        }
        break;
    case AGT_CB_APPLY:
        /* database manipulation done here */
        /* Edit数のカウントアップ */
        edit_measurement_object_act_cnt++;
        break;
    case AGT_CB_COMMIT:
        /* device instrumentation done here */
        switch (editop) {
        case OP_EDITOP_LOAD:
            break;
        case OP_EDITOP_MERGE:
        case OP_EDITOP_REPLACE:
        case OP_EDITOP_CREATE:
            /* 管理テーブルを更新 */
            res = i_pfm_mng_rx_window_edit(k_performance_measurement_objects_rx_window_measurement_objects_measurement_object, 0, newval_val, SAA_PFM_MNG_RX_ACT_FLG);
            if(res != NO_ERR){
                if(LOGWARN){
                    log_warn("\n%s: object_name is incorrect.",__func__);
                }
                return res;
            }

            /* 全Edit完了時にMSIを送信する */
            edit_measurement_object_act_cnt--;
            if(edit_measurement_object_act_cnt == 0)
            {
                /* MSI送信 */
                res = i_pfm_mng_rx_window_act_flag_commit();
                if(res != NO_ERR){
                    if(LOGWARN){
                        log_warn("\n%s: edit_msi failed.",__func__);
                    }
                }
            }
            break;
        case OP_EDITOP_DELETE:
            break;
        default:
            res = SET_ERROR(ERR_INTERNAL_VAL);
        }
        break;
    case AGT_CB_ROLLBACK:
        /* undo device instrumentation here */
        break;
    default:
        res = SET_ERROR(ERR_INTERNAL_VAL);
    }
    return res;

} /* u_o_ran_performance_management_performance_measurement_objects_rx_window_measurement_objects_active_edit */


